import React, { useEffect, useState } from 'react';
import api from './api/posts';

function App() {
  const [posts, setPosts] = useState([])



  useEffect(() => {
    const fetchPosts = async () => {
      try {
        const responce = await api.get('/locations/units/map/simple')
        setPosts(responce.data)
      }
      catch (err) {
        if (err.responce) {
        console.log(err.responce.data)
        console.log(err.responce.status)
        console.log(err.responce.headers)
      }
      else {
        console.log(err.message)
      }
    }
    }

    fetchPosts()
  }, [])

  console.log(posts)

  return (
    <div>
      <div className="block max-w-md p-6 bg-white border border-gray-200 
      rounded-lg shadow hover:bg-gray-100 dark:bg-gray-800 dark:border-gray-700 dark:hover:bg-gray-700">
        <h1>Posts</h1>
        {posts.map((post) => (
          <div key={post.lat}>
            <h3 className='text-indigo-600 font-bold'>{post.lon}</h3>
            <p className=''>{post.location}</p>
            <p>{post.link}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
